import React, { Component } from "react";
import ReactPlayer from "react-player";

class MediaPlayer extends Component {
  state = {};
  render() {
    return (
      <ReactPlayer
        url="https://www.youtube.com/embed/Ke90Tje7VS0"
        config={{
          youtube: {
            playerVars: {
              modestbranding: 1,
              controls: 1,
              showinfo: 0
            }
          },
          facebook: {
            appId: "420240272057124"
          }
        }}
        height="220px"
        width="400px"
      />
    );
  }
}

export default MediaPlayer;
